function detailUserDialog(el) {
    var data = $(el).data('detail');
    $('.clear').val('');
    $('#md-User-detail').modal('show');

				$('#Detail-User-Active').prop('checked', data.active);
				$('#Detail-User-Fullname').val(data.fullname);
				$('#Detail-User-IdRole').val(data.idRole);
				$('#Detail-User-Mail').val(data.mail);
				$('#Detail-User-Password').val(data.password);
				$('#Detail-User-PhoneNumber').val(data.phoneNumber);
				$('#Detail-User-PhotoBase64').val(data.photoBase64);
				$('#Detail-User-Token').val(data.token);
				$('#Detail-User-Username').val(data.username);

}
